import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const ImageSlider = () => {
  let settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slideToShow: 1,
    slideToScroll: 1,
    autoplay: true,
  };
  return <div>
    <Slider {...settings}>
      <div>
        <h1>test</h1>
      </div>
      <div>
        <h1>test</h1>
      </div>
      <div>
        <h1>test</h1>
      </div>
    </Slider>
  </div>;
};

export default ImageSlider;
